import React from 'react'

export const IndividualData = ({individualExcelData}) => {
    return (
        <>
           <th><time datetime="hh:mm:ss">{individualExcelData.Time}</time></th>
            <th>{individualExcelData.Text}</th>
      
        </>
    )
}
